import React from "react";

function MovieCard({ movie }) {
  return (
    <div style={styles.card}>
      <h3>{movie.title}</h3>
      <p>‚≠ê Rating: {movie.rating}</p>
      <p>{movie.description}</p>
    </div>
  );
}

const styles = {
  card: {
    padding: "15px",
    margin: "10px",
    background: "#1e1e1e",
    color: "white",
    borderRadius: "10px",
    width: "250px"
  }
};

export default MovieCard;
